import "./App.css";
import React from "react";
import Home from "../components/home/Home";
import { BrowserRouter, Route, Routes as RouterRoutes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <h1>Henry Dogs</h1>
        <RouterRoutes>
          <Route exact path="/" element={<Home />} />
        </RouterRoutes>
      </div>
    </BrowserRouter>
  );
}

export default App;
